package Array_list;

import java.util.HashSet;

public class Exercise_9_Hashset {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		HashSet<String> colors = new HashSet<String>();
		
		colors.add("Red");
		colors.add("White");
		colors.add("Blue");
		colors.add("Black");
		colors.add("Brown");
		colors.add("Gray");
		colors.add("Green");
		
		
		System.out.println("The Hash set contains the follwing colors: " + colors);
		
		
		
		
	}

}
